        return(
            <div>
                <Header/>
                <h1>hello next js</h1>
                <Footer/>
            </div>
        )
    }
}

export default () => {
    return(
        <div>
            <Header/>
            <h1>hello next js</h1>
            <Footer/>
        </div>
    )
}
